# ## 자동 미분과 선형회귀 실습

# 딥러닝 알고리즘을 제공하는 라이브러리 케라스로 선형회귀를 구현해봅시다.

# In[1]:


import tensorflow as tf # alias 


# In[2]:


## tape_gradient()는 자동 미분 기능을 수행합니다. 
## 임의로 2 * W^2 + 5 라는 식을 세워서 
## W에 대한 미분


# In[3]:


w = tf.Variable(2.0)

def f(w):
    y = w**2
    z = 2*y + 5
    return z


# In[4]:


# gradients를 출력하면 w에 대한 미분값이 저장되는 것을 확인 가능

with tf.GradientTape() as tape:
    z = f(w)

result = tape.gradient(z, [w])
print(result)


# - 자동미분구현실습

# In[5]:


# 학습될 가중치 w와 4
# 사용될 편향 b를 정의하자. 1

w = tf.Variable(4.0)
b = tf.Variable(1.0)


# In[6]:


# 가설이라는 명칭으로 함수를 정의해보자.
def hypothesis(x):
    return w * x + b # w= 4, b = 1


# In[7]:


X_test = [3.5, 5, 5.5, 6]
hypothesis(X_test).numpy()


# In[8]:


## 평균제곱오차를 손실함수로 정의
def mse_loss(y, y_pred):
    # 두 개의 차이값을 제곱해서 평균을 구한다
    return tf.reduce_mean(tf.square(y-y_pred))


# In[9]:


X = [1, 2, 3, 4, 5, 6, 7, 8, 9] # 공부하는 시간
y = [11, 22, 33, 44, 53, 66, 77, 87, 95] # 각 공부하는 시간에 맵핑되는 성적


# In[10]:


### 옵티마이저
## 학습률(Learning Rate) 0.01
optimizer = tf.optimizers.SGD(0.01)


# In[11]:


### 약 100번에 걸쳐서 경사하강법을 수행
for i in range(301):
    with tf.GradientTape() as tape:
    # 현재 parameter에 기반한 입력값(X)= 공부하는 시간
    # 에 대한 예측값을 y_pred로 설정
        y_pred = hypothesis(X)

    # 평균제곱오차(MSE)를 계산
        cost = mse_loss(y, y_pred) # mse

    # loss function에 대한 parameter 미분값 계산 
    gradients = tape.gradient(cost, [w, b])

    # 파라미터 업데이트 (w, b)값이 업데이트가 됩니다. 
    optimizer.apply_gradients(zip(gradients, [w,b]))

    if i % 10 == 0:
        print("epoch : {} | w의 값: {:.4f} | b의값 {:.4} | cost{:.4f}".format(i,
                                                                               w.numpy(),
                                                                               b.numpy(),
                                                                               cost))



